const en = {
    prices: {
        header: 'Latest Cryptocurrency Prices by Daniel',
        text: {
            btc: 'Bitcoin',
            etj: 'Ethereum',
            ltc: 'Litecoin',
        },
        currency: {
            btc: '- BTCUSD: ',
            eth: '- ETHUSD: ',
            ltc: '- LTCUSD: ',
        },
    },
};

export default en;
